INSERT INTO `v1_39d2e9f90055ddb30362da5d7ef68e12394695f57beab96d2b3e83353b2acf49` VALUES ("", 38614078, 0, "", 38614, "vo_wac_38614", "", 21, 0, "", "vo_wac_38614_002");
